description:
Episode Title: &quot;Malicious Skateboarder?; Too Young to Live Alone&quot;
Episode Order: Season 18, Episode 128
Original Air Date: February 04, 2014

&quot;An adult cyclist files criminal charges against an 11-year-old he accuses of throwing a skateboard under his bike; a woman sues her childhood friend for breaking their lease.&quot;

Seed and enjoy! 

NOTE: A school closings sidebar/bottom bar starts about 6 minutes into the video. Obviously, I can't do anything about this, but the episode is all there. Sorry!
